const initialState = {
  startDate: '',
  totalMeetings: false,
  firstName: 'David',
  lastName: 'Hardy',
}

const historicalDataReducer = (state = initialState, action) => {
  switch (action.type) {
    default:
      return state;
  }
}

export default historicalDataReducer;
